tablas <- c("2010", "2015", "2020")
for(i in tablas){
load(file = paste0(here::here(),"/Bases/IME_", i, ".RData"))
}

##Se cambia el nombre de la columna A√ëO, para evitar problemas de puntuaci√≥n
## Se cambia la variable a√±o a factor
for(i in tablas){
assign(paste0("tabla_",i), get(paste0("tabla_",i)) %>% 
                            rename("ANIO" = "A√ëO") %>%
                             filter(NOM_ENT != "Nacional") %>%
                              dplyr::mutate(ANIO = as.factor(.$ANIO)))
}

# Se multiplica por -1, debido a que son indicadores de carencia 
for(i in tablas){   
  assign(paste0("DP2_datos_", i), (-1 * get(paste0("tabla_", i))[5:13])) 
}

require(p2distance)
##Calculo del M√©todo de Distancias DP2
for(i in tablas){
assign(paste0("ind_",i), p2distance(matriz = as.matrix(get(paste0("DP2_datos_", i))), 
                                     reference_vector = get(paste0("minRV_", i)), 
                                      iterations = 50))
}
iteration <- lapply(1:3, function(x) get(paste0("ind_", tablas[x]))[["iteration"]])
for(i in tablas){
assign(paste0("DP2_",i), cbind(get(paste0("tabla_",i)), get(paste0("ind_",i))[["p2distance"]]))
}

# Se cambian los nombres de las columnas 
for(i in 1:3){
  columns = get(paste0("DP2_",tablas[i]))
  colnames(columns) = c("CVE_ENT", "NOM_ENT", "POB_TOT", "ANIO",
                        "ANALF", "SBASC", "OVSDE", "OVSEE", "OVSAE", "VHAC", "OVPT", "PL.5000", "PO2SM",
                        paste0("IM_", tablas[i]))
  assign(paste0("DP2_",tablas[i]), columns)
  rm(columns)
}

min.strata <- NULL
for(i in 1:3){
  min.strata[[i]] <- stderr[[i]] %>%
                      as.data.frame() %>% 
                       slice(which.min(.$CV))
}
for(i in 1:3){
  assign(paste0("strata.DP2_",tablas[i]), strata.cumrootf(get(paste0("DP2_",tablas[i]))[,14],
                                                           CV = 0.05,
                                                            Ls = 5,
                                                             alloc = c(0.5, 0, 0.5), 
                                                              nclass = min.strata[[i]][,1]))
}
##Se agrega a la base DP2
for(i in 1:3){
  assign(paste0("DP2_",tablas[i]), data.frame(get(paste0("DP2_", tablas[i])),
                                               get(paste0("strata.DP2_", tablas[i]))[["stratumID"]]))
}

# Se cambian los nombres de las columnas 
for(i in 1:3){
  columns = get(paste0("DP2_",tablas[i]))
  colnames(columns) = c("CVE_ENT", "NOM_ENT", "POB_TOT", "ANIO",
                        "ANALF", "SBASC", "OVSDE", "OVSEE", "OVSAE", "VHAC", "OVPT", "PL.5000", "PO2SM",
                        paste0("IM_",tablas[i]), paste0("GM_",tablas[i]))
  assign(paste0("DP2_",tablas[i]), columns)
  rm(columns)
}

# Se cambian los levels a los grados de marginaci√≥n correspondientes
for(i in tablas){
  niveles = get(paste0("DP2_",i)) 
  levels(niveles[,15]) = c("Muy alto", "Alto", "Medio", "Bajo", "Muy bajo")
  assign(paste0("DP2_",i), niveles)
}

